import React, { useState } from "react";

import Homepage_Btn from './Homepage_Btn.js'

export const My_Reviews = (props) => {

    const Review_Container = (props) => {

        console.log(props)

        return <React.Fragment>

        <div></div>

        </React.Fragment>

    }

    const Fetch_Posted_Reviews = async (input) =>{

        const Review_Posted = await fetch('/read_reviews',{
            method: 'GET',
            headers:{
                'Content-Type': 'application/json'
            },
            body: JSON.stringify(input)
        })

        return await Review_Posted.json();

    }

    const Dispense_Review_Data = (input)=>{

        let USER;

        if(input.id){ USER = input.id}

        switch(USER.status){
        case('unverified'):
            return;
        
        case('verified'):
            USER = USER.userinfo
            return <Review_Container/>;

        case('undefined'):
            return;

        default:
            return;
    }
}

    return <React.Fragment>

        <div
        className="Personalize_Data_Page_Container"
        >

            <Homepage_Btn/>

            <div
            className="Personalized_Data_Container_Aligner"
            >
                <span
                className="Personalized_Data_Page_TextTitle"
                >
                My Reviews
                </span>
                <br></br>

                <span
                className="Personalized_Data_Page_TextTitle"
                >
                This Page
                <br></br>
                is Preparing
                </span>
            
                {Dispense_Review_Data(props)}
                

            </div>

        </div>

    </React.Fragment>

}

export default My_Reviews
